script:
reset();

const size = 128;
const maxHeight = 16;
const offset = 64;
const radius = size * 0.5 - 0.5;
for (let x = 0; x < size; x += 1) {
  for (let y = 0; y < 32; y += 1) {
    for (let z = 0; z < size; z += 1) {
      const baseHeight = (radius - Math.sqrt(
        (x - radius) ** 2
        + (z - radius) ** 2
      )) * 0.25;
      const height = (
       (
          Math.abs(noise.noise3d(x / 20, y / 40, z / 20)) * 0.3
          +  Math.abs(noise.noise3d(x / 40, y / 60, z / 40)) * 0.2
          +  Math.abs(noise.noise3d(x / 60, y / 80, z / 60)) * 0.5
        ) * (maxHeight + baseHeight)
      );
      let type = 0;
      if (y <= height) {
        type = 1;
      }
      update(x - offset, y, z - offset, type);
    }
  }
}

const elevator = {
  x: -4,
  y: 11,
  z: -4,
};
box(
  elevator.x, elevator.y, elevator.z,
  8, 9, 8,
  1
);
box(
  elevator.x + 1, elevator.y + 1, elevator.z + 1,
  6, 7, 6,
  2
);
box(
  elevator.x + 2, elevator.y + 2, elevator.z + 2,
  4, 5, 4,
  0
);
box(
  elevator.x + 3, elevator.y + 2, elevator.z,
  2, 4, 2,
  0
);
